Неотъемлемая часть строительных работ, требующая особенных навыков и технического оснащения. Стоимость напрямую
зависит от габаритов и сложности задачи.
Если рассматривать существующие на сегодняшний день варианты, по которым будет проводиться снос зданий, то можно
выявить несколько методик:
 -ручной;
- полумеханизированный;
- механизированный;
Выбор конкретной методики, по которой будет проводиться снос сооружений, напрямую зависит от конечной цели,
поставленной перед подрядчиком.
